import React, {Component} from 'react';
import {Grid, Cell, Footer, FooterSection, FooterLinkList} from 'react-mdl';
import TextCarousel from "../../lib/index";
import PropTypes from 'prop-types';


class Landing extends Component {
  render(){
    const typistProps = {
      avgTypingDelay: 90,
      cursor: {
        hideWhenDone: true,
        hideWhenDoneDelay: 400
      }
    }
    const phrases = ["words", "chars", "phrases"];
    return(
      <h2>Hello! my name is Harris Schrick.<br/>
          I am a computer science student at Kansas State University in the college of Engineering.<br/>
          Some passions of mine are <TextCarousel phrases={phrases} typistProps={typistProps} />.<br/>
          This website is a place for me to update about work that I am doing inside and outside of class<br/>
          Feel free to look around and contact me at any time I will reply within one hour!</h2>
    )
  }
}

export default Landing;
